macro.metrics.update_metric_tree.macro_sql:
{% macro update_metric_tree(metric,metric_tree,metric_count=999)%}

    {# Now we see if the node already exists in the metric tree and return that if 
    it does so that we're not creating duplicates #}
    {%- if metric.name not in metric_tree|map(attribute="full_set") -%}

        {%- set full_set = metric_tree["full_set"] -%}
        {%- do full_set.append(metric.name) -%}
        {%- do metric_tree.update({'full_set':full_set}) -%}

    {%- endif -%}

    {%- do metric_tree["ordered_derived_set"].update({metric.name:metric_count}) -%}
    {%- set metric_count = metric_count - 1 -%}

    {# Here we create two sets, sets being the same as lists but they account for uniqueness. 
    One is the full set, which contains all of the parent metrics and the other is the leaf
    set, which we'll use to determine the leaf, or base metrics. #}

    {# We define parent nodes as being the parent nodes that begin with metric, which lets
    us filter out model nodes #}
    {%- set parent_metrics = metrics.get_metric_unique_id_list(metric) -%}

    {# We set an if condition based on if parent nodes. If there are none, then this metric
    is a leaf node and any recursive loop should end #}
        {%- if parent_metrics | length > 0 -%}

            {# Now we finally recurse through the nodes. We begin by filtering the overall list we
            recurse through by limiting it to depending on metric nodes and not ALL nodes #}
            {%- for parent_id in parent_metrics -%}

                {# Then we add the parent_id of the metric to the full set. If it already existed
                then it won't make an impact but we want to make sure it is represented #}
                {# {%- do full_set.append(parent_id) -%} #}
                {%- set full_set_plus = metric_tree["full_set"] -%}
                {%- if parent_id in metric_tree|map(attribute="full_set") -%}
                    {%- do full_set_plus.append(parent_id) -%}
                {%- endif -%}
                {%- do metric_tree.update({'full_set':full_set_plus}) -%}
                {# The parent_id variable here is a mapping back to the provided manifest and doesn't 
                allow for string parsing. So we create this variable to use instead #}
                {# {%- set parent_metric_name = (parent_id | string).split('.')[2] -%} #}

                {# And here we re-run the current macro but fill in the parent_id so that we loop again
                with that metric information. You may be wondering, why are you using parent_id? Doesn't 
                the DAG always go from parent to child? Normally, yes! With this, no! We're reversing the 
                DAG and going up to parents to find the leaf nodes that are really parent nodes. #}
                {%- set new_parent = metrics.get_metric_relation(parent_id) -%}

                {%- set metric_tree =  metrics.update_metric_tree(new_parent,metric_tree,metric_count) -%}

            {%- endfor -%}

        {%- else -%}

            {%- set parent_set_plus = metric_tree["parent_set"] -%}
            {%- if parent_id in metric_tree|map(attribute="full_set") -%}
                {%- do parent_set_plus.append(metric.name) -%}
            {%- endif -%}
            {%- do metric_tree.update({'parent_set':parent_set_plus}) -%}

        {%- endif -%}

        {%- set derived_set_plus = ( metric_tree["full_set"] | reject('in',metric_tree["parent_set"]) | list) -%}
        {%- do metric_tree.update({'derived_set':derived_set_plus}) -%}

    {%- do return(metric_tree) -%}

{% endmacro %}

macro.metrics.get_metric_tree.macro_sql:
{% macro get_metric_tree(metric_list)%}

{# We are creating the metric tree here - this includes all the leafs (first level parents)
, the derived metrics, and the full combination of them both #}

{# This line creates the metric tree dictionary and the full_set key. 
Full Set contains ALL metrics that are referenced, which includes metrics in the macro
AND all parent/derived metrics. #}
{%- set metric_tree = {'full_set':[]} %}
{# The parent set is a list of parent metrics that are NOT derived metrics. IE if 
metric C is built off of metric A and B, A and B would be the parent metrics because they 
are both upstream of Metric C AND not derived metrics themselves. #}
{%- do metric_tree.update({'parent_set':[]}) -%}
{# The derived set is a list of derived metrics. This includes all derived metrics referenced
in the macro itself OR upstream of the metrics referenced in the macro #}
{%- do metric_tree.update({'derived_set':[]}) -%}
{# The base set is the list of metrics that are provided into the macro #}
{%- do metric_tree.update({'base_set':[]}) -%}
{# The ordered derived set is the list of derived metrics that are ordered based on their
node depth. So if Metric C were downstream of Metric A and B, which were also derived metrics,
Metric C would have the value of 999 (max depth) and A and B would have 998, representing that they
are one depth upstream #}
{%- do metric_tree.update({'ordered_derived_set':{}}) -%}

{% set base_set_list = []%}
{% for metric in metric_list %}
    {%- do base_set_list.append(metric.name) -%}
    {%- set metric_tree = metrics.update_metric_tree(metric ,metric_tree) -%}
{% endfor %}
{%- do metric_tree.update({'base_set':base_set_list}) -%}

{# Now we will iterate over the metric tree and make it a unique list to account for duplicates #}
{% set full_set = [] %}
{% set parent_set = [] %}
{% set derived_set = [] %}
{% set base_set = [] %}

{% for metric_name in metric_tree['full_set']|unique%}
    {% do full_set.append(metric_name)%}
{% endfor %}
{%- do metric_tree.update({'full_set':full_set}) -%}

{% for metric_name in metric_tree['parent_set']|unique%}
    {% do parent_set.append(metric_name)%}
{% endfor %}
{%- do metric_tree.update({'parent_set':parent_set}) -%}

{% for metric_name in metric_tree['derived_set']|unique%}
    {% do derived_set.append(metric_name)%}
{% endfor %}
{%- do metric_tree.update({'derived_set':derived_set}) -%}

{% for metric in metric_tree['parent_set']|unique%}
    {%- do metric_tree['ordered_derived_set'].pop(metric) -%}
{% endfor %}

{# This section overrides the derived set by ordering the metrics on their depth so they 
can be correctly referenced in the downstream sql query #}
{% set ordered_expression_list = []%}
{% for item in metric_tree['ordered_derived_set']|dictsort(false, 'value') %}
    {% if item[0] in metric_tree["derived_set"]%}
        {% do ordered_expression_list.append(item[0])%}
    {% endif %}
{% endfor %}
{%- do metric_tree.update({'derived_set':ordered_expression_list}) -%}

{%- do return(metric_tree) -%}

{% endmacro %}

macro.metrics.update_faux_metric_tree.macro_sql:
{% macro update_faux_metric_tree(metric_definition, metric_tree, develop_yml, metric_count=999)%}


    {# Now we see if the node already exists in the metric tree and return that if 
    it does so that we're not creating duplicates #}
    {%- if metric_definition.name not in metric_tree|map(attribute="full_set") -%}

        {%- set full_set = metric_tree["full_set"] -%}
        {%- do full_set.append(metric_definition.name) -%}
        {%- do metric_tree.update({'full_set':full_set}) -%}

    {%- endif -%}

    {# Here we're starting with the highest level and assigning the metric tree that first level
    value. This is used before de-duping in get_faux_metric_tree #}
    {%- do metric_tree["ordered_derived_set"].update({metric_definition.name:metric_count}) -%}
    {%- set metric_count = metric_count - 1 -%}

    {# Here we create two sets, sets being the same as lists but they account for uniqueness. 
    One is the full set, which contains all of the parent metrics and the other is the leaf
    set, which we'll use to determine the leaf, or base metrics. #}

    {% set develop_metric_list = [] %}
    {% for develop_metric_name in develop_yml %}
        {% do develop_metric_list.append(develop_metric_name) %}
    {% endfor %}

    {# We define parent nodes as being the parent nodes that begin with metric, which lets
    us filter out model nodes #}
    {%- set parent_metrics = metrics.get_develop_unique_metric_id_list(metric_definition) -%}
    {# We set an if condition based on if parent nodes. If there are none, then this metric
    is a leaf node and any recursive loop should end #}
    {%- if parent_metrics | length > 0 -%}

        {# Now we finally recurse through the nodes. We begin by filtering the overall list we
        recurse through by limiting it to depending on metric nodes and not ALL nodes #}
        {%- for parent_metric_name in parent_metrics -%}

            {# Then we add the parent_id of the metric to the full set. If it already existed
            then it won't make an impact but we want to make sure it is represented. Will dedupe
            in final macro #}
            {%- set full_set_plus = metric_tree["full_set"] -%}
            {%- if parent_metric_name in metric_tree|map(attribute="full_set") -%}
                {%- do full_set_plus.append(parent_metric_name) -%}
            {%- endif -%}
            {%- do metric_tree.update({'full_set':full_set_plus}) -%}

            {# And here we re-run the current macro but fill in the parent_id so that we loop again
            with that metric information. You may be wondering, why are you using parent_id? Doesn't 
            the DAG always go from parent to child? Normally, yes! With this, no! We're reversing the 
            DAG and going up to parents to find the leaf nodes that are really parent nodes. #}

            {# So here we need to test if the parent id/metric name exists in the manifest OR in
            the develop yml. Manifest takes priority and then defaults back to yml if not present #}
            {% if parent_metric_name in develop_metric_list and parent_metric_name is not none %}
                {% set parent_metric_definition = develop_yml[parent_metric_name] %}
            {% else %}
                {%- set parent_metric_definition = metrics.get_metric_relation(parent_metric_name) -%}
            {% endif %}

            {%- set metric_tree =  metrics.update_faux_metric_tree(parent_metric_definition, metric_tree, develop_yml, metric_count) -%}

        {%- endfor -%}

    {%- else -%}

        {%- set parent_set_plus = metric_tree["parent_set"] -%}
        {%- do parent_set_plus.append(metric_definition.name) -%}
        {%- do metric_tree.update({'parent_set':parent_set_plus}) -%}

    {%- endif -%}

    {%- set derived_set_plus = ( metric_tree["full_set"] | reject('in',metric_tree["parent_set"]) | list) -%}
    {%- do metric_tree.update({'derived_set':derived_set_plus}) -%}

    {%- do return(metric_tree) -%}

{% endmacro %}

macro.metrics.get_models_grouping.macro_sql:
{%- macro get_models_grouping(metric_tree, metrics_dictionary) -%}
{#- 
The purpose of this macro is to create a dictionary that can be used by
gen_base_query and gen_aggregate_query in order to intelligently group
metrics together on whether they can be queried in the same query. These
will be grouped together with a unique model name as the key and the value 
containing the list of the metrics. This is complicated because we allow
different properties that affect the base query, so we can't do a single 
grouping based on model. As such, if a metric contains one of these properties
we have to create a group for that specific combination.

The properties that cause us to group the metric seperately are:
    - windows
    - filters
    - timestamp fields

In order to ensure consistency, we will also include those values in the 
dictionary so we can reference them from the metrics grouping (ie a single
location) instead of from a randomly selected metric in the list of metrics.

An example output looks like:
{
    'model_4f977327f02b5c04af4337f54ed81a17': {
        'metric_names':['metric_a','metric_b'],
        'metric_timestamp': order_date,
        'metric_filters':[
            MetricFilter(field='had_discount', operator='is', value='true'), 
            MetricFilter(field='order_country', operator='=', value='CA')
        ]
        'metric_window': MetricTime(count=14, period=<MetricTimePeriod.month: 'month'>)
    }
} 
 -#}

    {% set models_grouping = {} %}

    {% for metric_name in metric_tree.parent_set %}
        {% set metric_dictionary = metrics_dictionary[metric_name] %}

        {% set models_grouping = metrics.get_model_group(
                models_grouping=models_grouping,
                metric_model=metric_dictionary.metric_model,
                metric_model_name=metric_dictionary.metric_model_name,
                metric_name=metric_dictionary.name,
                metric_timestamp=metric_dictionary.timestamp,
                metric_filters=metric_dictionary.filters,
                metric_window=metric_dictionary.window
            ) %}

    {% endfor %}

    {% do return(models_grouping) %}

{%- endmacro -%}

