    {%- endfor %}

    {%- for metric_name in metric_tree.parent_set %}
        {%- if not metrics_dictionary[metric_name].config.get("treat_null_values_as_zero", True) %}
        {{metric_name}} as {{metric_name}} {%- if not loop.last -%}, {%- endif -%}
        {%- else  %}  
