        {%- endif %}  
    {%- endfor %}  
    {#- Loop through leaf metric list -#}
    {% for group_name, group_values in models_grouping.items() %}
        {%- if loop.first %}
    from {{ group_name }}__final
        {%- else %}
            {%- if grain %}
    full outer join {{group_name}}__final
        using (
            date_{{grain}}
            {%- for calendar_dim in calendar_dimensions %}
            , {{ calendar_dim }}
            {% endfor %}
            {%- for dim in dimensions %}
            , {{ dim }}
            {%- endfor %}
        )
            {%- else -%}
