    cross join {{group_name}}__final
                {%- endif %}
            {%- endif %}
        {%- endif -%}
    {%- endfor %} 
{# #}
)

{%- for cte_number in cte_numbers | unique | sort %}
{% set previous_cte_number = cte_number - 1 %}
